import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButton, IonIcon, IonFooter } from '@ionic/react';
import { settingsOutline, personCircleOutline } from 'ionicons/icons';
import ExploreContainer from '../components/ExploreContainer';
import './Home.css';

const Home: React.FC = () => {
  return (
    <IonPage>
      <IonHeader className="ion-no-border redBackground">
        <IonToolbar>
        {/* <IonButtons slot="start" className="largeButton"> */}
          <IonButton routerLink="/profile" fill="clear" size="large" color="light">    
            <IonIcon icon={personCircleOutline} />      
          </IonButton>
        {/* </IonButtons> */}
        {/* <IonButtons slot="end" className="largeButton"> */}
          <IonButton className="right" routerLink="/settings" fill="clear" size="large" color="light">    
            <IonIcon icon={settingsOutline} />
          </IonButton>
        {/* </IonButtons> */}
        </IonToolbar>
      </IonHeader>
      <IonContent>

      </IonContent>
      <IonFooter className="ion-no-border">
        <IonToolbar>
          <IonTitle>Footer - No Border</IonTitle>
        </IonToolbar>
    </IonFooter>
    </IonPage>
  );
};

export default Home;
